import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Download, Briefcase, GraduationCap, Star, Calendar, MapPin } from 'lucide-react';

interface Experience {
  id: number;
  title: string;
  company: string;
  location: string;
  period: string;
  description: string[];
  technologies: string[];
}

interface Education {
  id: number;
  degree: string;
  institution: string;
  location: string;
  period: string;
  description: string;
}

const Resume: React.FC = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const [activeTab, setActiveTab] = useState<'experience' | 'education' | 'skills'>('experience');

  const experiences: Experience[] = [
    {
      id: 1,
      title: "Senior Full Stack Developer",
      company: "Tech Innovations Inc.",
      location: "San Francisco, CA",
      period: "2022 - Present",
      description: [
        "Led development of enterprise-level web applications using React, Node.js, and AWS",
        "Mentored junior developers and conducted code reviews to maintain code quality",
        "Implemented CI/CD pipelines and automated testing strategies",
        "Collaborated with cross-functional teams to deliver high-impact features"
      ],
      technologies: ["React", "Node.js", "AWS", "Docker", "MongoDB", "TypeScript"]
    },
    {
      id: 2,
      title: "Frontend Developer",
      company: "Digital Solutions Ltd.",
      location: "New York, NY",
      period: "2020 - 2022",
      description: [
        "Developed responsive web applications using modern JavaScript frameworks",
        "Optimized application performance and user experience",
        "Worked closely with designers to implement pixel-perfect UI components",
        "Participated in agile development processes and sprint planning"
      ],
      technologies: ["React", "Vue.js", "JavaScript", "CSS3", "HTML5", "Git"]
    },
    {
      id: 3,
      title: "Junior Developer",
      company: "StartupXYZ",
      location: "Austin, TX",
      period: "2019 - 2020",
      description: [
        "Built and maintained web applications using various technologies",
        "Collaborated with senior developers on large-scale projects",
        "Learned best practices in software development and team collaboration",
        "Contributed to open-source projects and community initiatives"
      ],
      technologies: ["JavaScript", "Python", "Django", "PostgreSQL", "Git"]
    }
  ];

  const education: Education[] = [
    {
      id: 1,
      degree: "Master of Science in Computer Science",
      institution: "Stanford University",
      location: "Stanford, CA",
      period: "2017 - 2019",
      description: "Specialized in software engineering and artificial intelligence. Completed thesis on machine learning applications in web development."
    },
    {
      id: 2,
      degree: "Bachelor of Science in Computer Science",
      institution: "University of California, Berkeley",
      location: "Berkeley, CA",
      period: "2013 - 2017",
      description: "Graduated with honors. Focused on web technologies and software development principles."
    }
  ];

  const skillCategories = [
    {
      category: "Frontend Development",
      skills: [
        { name: "React", level: 95 },
        { name: "TypeScript", level: 90 },
        { name: "JavaScript", level: 95 },
        { name: "HTML/CSS", level: 90 },
        { name: "Vue.js", level: 85 }
      ]
    },
    {
      category: "Backend Development",
      skills: [
        { name: "Node.js", level: 90 },
        { name: "Python", level: 85 },
        { name: "Express.js", level: 90 },
        { name: "Django", level: 80 },
        { name: "REST APIs", level: 95 }
      ]
    },
    {
      category: "DevOps & Tools",
      skills: [
        { name: "Git", level: 95 },
        { name: "Docker", level: 85 },
        { name: "AWS", level: 80 },
        { name: "CI/CD", level: 85 },
        { name: "Linux", level: 80 }
      ]
    }
  ];

  return (
    <section id="resume" className="section-padding bg-secondary-50 dark:bg-dark-900">
      <div className="container-max">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-secondary-900 dark:text-white mb-4">
            Resume
          </h2>
          <p className="text-xl text-secondary-600 dark:text-secondary-300 max-w-3xl mx-auto mb-8">
            My professional journey, education, and technical expertise.
          </p>
          <button className="btn-primary flex items-center gap-2 mx-auto">
            <Download size={20} />
            Download Full Resume
          </button>
        </motion.div>

        {/* Tab Navigation */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.2 }}
          className="flex flex-wrap justify-center gap-4 mb-12"
        >
          <button
            onClick={() => setActiveTab('experience')}
            className={`flex items-center gap-2 px-6 py-3 rounded-lg font-medium transition-all duration-200 ${
              activeTab === 'experience'
                ? 'bg-primary-600 text-white shadow-lg'
                : 'bg-white dark:bg-dark-800 text-secondary-600 dark:text-secondary-300 hover:bg-primary-50 dark:hover:bg-primary-900/20 hover:text-primary-600 dark:hover:text-primary-400'
            }`}
          >
            <Briefcase size={20} />
            Experience
          </button>
          <button
            onClick={() => setActiveTab('education')}
            className={`flex items-center gap-2 px-6 py-3 rounded-lg font-medium transition-all duration-200 ${
              activeTab === 'education'
                ? 'bg-primary-600 text-white shadow-lg'
                : 'bg-white dark:bg-dark-800 text-secondary-600 dark:text-secondary-300 hover:bg-primary-50 dark:hover:bg-primary-900/20 hover:text-primary-600 dark:hover:text-primary-400'
            }`}
          >
            <GraduationCap size={20} />
            Education
          </button>
          <button
            onClick={() => setActiveTab('skills')}
            className={`flex items-center gap-2 px-6 py-3 rounded-lg font-medium transition-all duration-200 ${
              activeTab === 'skills'
                ? 'bg-primary-600 text-white shadow-lg'
                : 'bg-white dark:bg-dark-800 text-secondary-600 dark:text-secondary-300 hover:bg-primary-50 dark:hover:bg-primary-900/20 hover:text-primary-600 dark:hover:text-primary-400'
            }`}
          >
            <Star size={20} />
            Skills
          </button>
        </motion.div>

        {/* Tab Content */}
        <motion.div
          key={activeTab}
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          {activeTab === 'experience' && (
            <div className="space-y-8">
              {experiences.map((exp, index) => (
                <motion.div
                  key={exp.id}
                  initial={{ opacity: 0, x: -50 }}
                  animate={inView ? { opacity: 1, x: 0 } : {}}
                  transition={{ duration: 0.6, delay: 0.4 + index * 0.1 }}
                  className="bg-white rounded-xl p-8 shadow-lg hover:shadow-xl transition-all duration-300"
                >
                  <div className="flex flex-col lg:flex-row lg:items-center lg:justify-between mb-4">
                    <div>
                      <h3 className="text-2xl font-bold text-secondary-900 dark:text-white mb-2">
                        {exp.title}
                      </h3>
                      <p className="text-lg text-primary-600 font-medium mb-2">
                        {exp.company}
                      </p>
                      <div className="flex items-center gap-4 text-secondary-500 dark:text-secondary-400">
                        <div className="flex items-center gap-1">
                          <MapPin size={16} />
                          {exp.location}
                        </div>
                        <div className="flex items-center gap-1">
                          <Calendar size={16} />
                          {exp.period}
                        </div>
                      </div>
                    </div>
                  </div>
                  
                  <ul className="space-y-2 mb-6">
                    {exp.description.map((item, idx) => (
                      <li key={idx} className="flex items-start gap-3">
                        <div className="w-2 h-2 bg-primary-600 rounded-full mt-2 flex-shrink-0"></div>
                        <span className="text-secondary-600 dark:text-secondary-300">{item}</span>
                      </li>
                    ))}
                  </ul>
                  
                  <div className="flex flex-wrap gap-2">
                    {exp.technologies.map((tech) => (
                      <span
                        key={tech}
                        className="px-3 py-1 bg-primary-100 dark:bg-primary-900/30 text-primary-700 dark:text-primary-300 rounded-full text-sm font-medium"
                      >
                        {tech}
                      </span>
                    ))}
                  </div>
                </motion.div>
              ))}
            </div>
          )}

          {activeTab === 'education' && (
            <div className="space-y-8">
              {education.map((edu, index) => (
                <motion.div
                  key={edu.id}
                  initial={{ opacity: 0, x: -50 }}
                  animate={inView ? { opacity: 1, x: 0 } : {}}
                  transition={{ duration: 0.6, delay: 0.4 + index * 0.1 }}
                  className="bg-white rounded-xl p-8 shadow-lg hover:shadow-xl transition-all duration-300"
                >
                  <div className="flex flex-col lg:flex-row lg:items-center lg:justify-between mb-4">
                    <div>
                      <h3 className="text-2xl font-bold text-secondary-900 dark:text-white mb-2">
                        {edu.degree}
                      </h3>
                      <p className="text-lg text-primary-600 font-medium mb-2">
                        {edu.institution}
                      </p>
                      <div className="flex items-center gap-4 text-secondary-500 dark:text-secondary-400">
                        <div className="flex items-center gap-1">
                          <MapPin size={16} />
                          {edu.location}
                        </div>
                        <div className="flex items-center gap-1">
                          <Calendar size={16} />
                          {edu.period}
                        </div>
                      </div>
                    </div>
                  </div>
                  
                  <p className="text-secondary-600 dark:text-secondary-300 leading-relaxed">
                    {edu.description}
                  </p>
                </motion.div>
              ))}
            </div>
          )}

          {activeTab === 'skills' && (
            <div className="space-y-8">
              {skillCategories.map((category, index) => (
                <motion.div
                  key={category.category}
                  initial={{ opacity: 0, y: 30 }}
                  animate={inView ? { opacity: 1, y: 0 } : {}}
                  transition={{ duration: 0.6, delay: 0.4 + index * 0.1 }}
                  className="bg-white dark:bg-dark-800 rounded-xl p-8 shadow-lg dark:shadow-dark-900/50"
                >
                  <h3 className="text-2xl font-bold text-secondary-900 dark:text-white mb-6">
                    {category.category}
                  </h3>
                  <div className="space-y-4">
                    {category.skills.map((skill) => (
                      <div key={skill.name}>
                        <div className="flex justify-between items-center mb-2">
                          <span className="font-medium text-secondary-700 dark:text-secondary-300">
                            {skill.name}
                          </span>
                          <span className="text-sm text-secondary-500 dark:text-secondary-400">
                            {skill.level}%
                          </span>
                        </div>
                        <div className="w-full bg-secondary-200 rounded-full h-2">
                          <motion.div
                            initial={{ width: 0 }}
                            animate={inView ? { width: `${skill.level}%` } : {}}
                            transition={{ duration: 1, delay: 0.8 + index * 0.1 }}
                            className="bg-primary-600 h-2 rounded-full"
                          />
                        </div>
                      </div>
                    ))}
                  </div>
                </motion.div>
              ))}
            </div>
          )}
        </motion.div>
      </div>
    </section>
  );
};

export default Resume;
